import React from 'react';
import { BrowserRouter } from 'react-router-dom';
import { provider } from 'react-redux';

import GlobalStyle from './styles/global';
import Header from './components/Header';
import Routes from './routes';

function App() {
  return (
    <provider>
    <BrowserRouter>
      <Header />
      <Routes />
      <GlobalStyle />
    </BrowserRouter>
    </provider>
  );
}

export default App;
